import React, { useState } from 'react';
import { BrowserRouter as Router, Route,na } from 'react-router-dom';
import RegistrationForm from './components/Registration/register';
import Dashboard from './components/Dashboard/dashboard';
import Feedback from './components/Feedback/feedback';
import HomePage from './components/Homepage/homepage';

function App() {
  const [loggedIn, setLoggedIn] = useState(false);

  const handleLogin = () => {
    setLoggedIn(true);
  };

  return (
    <Router>
      <div className="app-container">
        <h1>Maternal Health Care App</h1>

          <Route path="/register">
            <RegistrationForm />
          </Route>

          <Route path="/dashboard">
            {loggedIn ? <Dashboard /> : <Redirect to="/" />}
          </Route>

          <Route path="/feedback">
            <Feedback />
          </Route>

          <Route path="/">
            {loggedIn ? <Redirect to="/dashboard" /> : <HomePage onLogin={handleLogin} />}
          </Route>
      </div>
    </Router>
  );
}

export default App;
